webpackJsonp([0xb308de8da380],{7853:function(e,t){e.exports={data:{post:{html:'<p>Today is closet cleaning day. Everything that hasn\'t been worn for a year will be considered for the <em>Altkleidersammlung</em>. Items with sentimental value are however excluded.</p>\n<p><a href="http://www.flickr.com/photos/papascott/466863000/" title="Photo Sharing"><img src="https://farm1.static.flickr.com/211/466863000_ca98d1236a.jpg" width="500" height="375" alt="IMG_1979" /></a></p>\n<p>MamaMaus made this as my Christmas present in 1982 (or was it 1981?). I know there are a few <a href="http://sibylle.blogg.de/">knitting fans</a> among my readers.</p>\n<p>There\'s no danger of PapaScott becoming a knitting blog, though. MamaMaus hasn\'t touched a knitting needle in nearly 25 years.</p>',fields:{title:"Sweater",date:"21 Apr 2007",url:"https://papascott.de/2007-04-21-sweater/"}}},pathContext:{slug:"/2007-04-21-sweater/",prev:{fields:{title:"Knut Wochen",date:"21 Apr 2007",slug:"/2007-04-21-knut-wochen/"}},next:{fields:{title:"Jura XF50",date:"24 Apr 2007",slug:"/2007-04-24-jura-xf50/"}}}}}});
